INSERT INTO movies (id,title, tagline, overview, titleEmbedding, taglineEmbedding, overviewEmbedding) VALUES(62177, 'Brave', 'Change your fate.', 'Brave is set in the mystical Scottish Highlands, where Mérida is the princess of a kingdom ruled by King Fergus and Queen Elinor. An unruly daughter and an accomplished archer, Mérida one day defies a sacred custom of the land and inadvertently brings turmoil to the kingdom. In an attempt to set things right, Mérida seeks out an eccentric old Wise Woman and is granted an ill-fated wish. Also figuring into Mérida’s quest — and serving as comic relief — are the kingdom’s three lords: the enormous Lord MacGuffin, the surly Lord Macintosh, and the disagreeable Lord Dingwall.', '[0.02504405565559864,0.07257863879203796,-0.03815166652202606,0.052313707768917084,0.025349527597427368,0.02673347294330597,-0.020245496183633804,-0.03353751450777054,0.05248051881790161,0.019901948049664497,0.01012181956321001,-0.03791916370391846,0.05410217493772507,-0.026317764073610306,0.023358996957540512,-0.001130958553403616,-0.025272980332374573,0.029475953429937363,-0.08972172439098358,-0.011709857732057571,-0.11745445430278778,0.021808462217450142,0.05638699606060982,0.0322660431265831,-0.014110918156802654,0.053303252905607224,0.03455999493598938,0.07960567623376846,0.07883148640394211,-0.04036698862910271,0.044622112065553665,-0.040391504764556885,0.04303866624832153,-0.023888226598501205,-0.05159866064786911,-0.054596804082393646,-0.010842492803931236,-0.0535474456846714,0.06831490248441696,-0.03673607110977173,-0.05852027237415314,-0.087487131357193,0.016636405140161514,0.007076921872794628,-0.06012466549873352,0.041515227407217026,0.01680898852646351,-0.07580218464136124,0.010270625352859497,-0.04879492148756981,0.05293276906013489,-0.0557243786752224,-0.06995324790477753,-0.10755739361047745,0.05114035680890083,0.004103523679077625,0.03196794167160988,-0.05381375178694725,0.057861391454935074,0.06359841674566269,0.0845286175608635,-0.00